fn main() {
    assert_eq!(Solution::count_homogenous("abbcccaa".to_string()), 13);
    assert_eq!(Solution::count_homogenous("xy".to_string()), 2);
    assert_eq!(Solution::count_homogenous("zzzzz".to_string()), 15);
    assert_eq!(Solution::count_homogenous("".to_string()), 49965);
}

struct Solution;
impl Solution {
    pub fn count_homogenous(s: String) -> i32 {
        let mut count = 0;
        let mut prev = ' ';
        let mut prev_count = 0;
        for c in s.chars() {
            if c == prev {
                prev_count += 1;
            } else {
                prev = c;
                prev_count = 1;
            }
            count += prev_count as i128;
        }
        count %= 1_000_000_007;
        count as i32
    }
}
